import FAQs from './FAQS';
import FeatureSection from './Features';
import Header from './header';
import Landing from './landing';

function Home() {
  return (
    <>
    <Header />
    <Landing />
    <FeatureSection />
    <FAQs />
    </>
  );
}

export default Home;
